# LLMSwitch AJV Module

基于 AJV (Another JSON Schema Validator) 的 LLMSwitch 模块，用于 OpenAI <> Anthropic 协议转换。

## 🚀 概述

这个模块提供了一个基于标准 JSON Schema 的协议转换实现，作为现有 LLMSwitch 的现代化替代方案。通过使用 AJV，我们实现了：

- ✅ **严格的 Schema 验证** - 基于 JSON Schema Draft 7 标准
- ✅ **高性能转换** - 编译时 Schema 缓存，毫秒级验证
- ✅ **完整的错误处理** - 详细的验证错误和调试信息
- ✅ **黑盒测试验证** - 基于真实 codex 样本数据的完整测试覆盖
- ✅ **生产就绪** - 经过 20+ 真实样本测试验证

## 📋 特性

- 🔍 **智能格式检测** - 自动识别请求/响应格式，不依赖文件名
- 🛡️ **完整的协议支持** - 支持 OpenAI 和 Anthropic 的完整 API 规范
- 🔄 **双向转换** - OpenAI ⇄ Anthropic 请求和响应的无缝转换
- 📊 **性能监控** - 内置转换时间和验证性能指标
- 🧪 **黑盒测试** - 使用真实捕获数据进行兼容性验证
- 🎯 **零引用错误** - 完全解决 Schema 引用和依赖问题

## 核心数据结构

### 1. 请求/响应 DTO

```typescript
interface LLMSwitchRequest {
  data: Record<string, unknown>;
  route: {
    providerId: string;
    modelId: string;
    requestId: string;
    timestamp: number;
  };
  metadata: Record<string, unknown>;
  debug: {
    enabled: boolean;
    stages: Record<string, unknown>;
  };
}

interface LLMSwitchResponse {
  data: Record<string, unknown>;
  metadata: Record<string, unknown>;
  usage?: Record<string, number>;
}
```

### 2. 转换配置

```typescript
interface ConversionConfig {
  enableStreaming: boolean;
  enableTools: boolean;
  strictMode: boolean;
  fallbackToOriginal: boolean;
  customSchemas: Record<string, any>;
}
```

### 3. 验证结果

```typescript
interface ValidationResult {
  valid: boolean;
  data?: any;
  errors?: Array<{
    instancePath: string;
    schemaPath: string;
    keyword: string;
    params: Record<string, any>;
    message?: string;
  }>;
}
```

## Schema 定义

### OpenAI Schemas

```typescript
// OpenAI ChatCompletion Request
const openAIChatRequestSchema = {
  type: 'object',
  required: ['messages'],
  properties: {
    model: { type: 'string' },
    messages: {
      type: 'array',
      items: { $ref: '#/$defs/openAIMessage' }
    },
    temperature: { type: 'number', minimum: 0, maximum: 2 },
    max_tokens: { type: 'integer', minimum: 1 },
    tools: {
      type: 'array',
      items: { $ref: '#/$defs/openAITool' }
    },
    tool_choice: {
      oneOf: [
        { type: 'string', enum: ['none', 'auto'] },
        { type: 'object', properties: { type: { const: 'function' }, function: { $ref: '#/$defs/functionChoice' } } }
      ]
    },
    stream: { type: 'boolean' }
  },
  $defs: {
    openAIMessage: {
      type: 'object',
      required: ['role', 'content'],
      properties: {
        role: { type: 'string', enum: ['system', 'user', 'assistant', 'tool'] },
        content: {
          oneOf: [
            { type: 'string' },
            { type: 'array', items: { type: 'object' } }
          ]
        },
        tool_calls: {
          type: 'array',
          items: { $ref: '#/$defs/toolCall' }
        },
        tool_call_id: { type: 'string' },
        name: { type: 'string' }
      }
    },
    openAITool: {
      type: 'object',
      required: ['type', 'function'],
      properties: {
        type: { const: 'function' },
        function: {
          type: 'object',
          required: ['name', 'parameters'],
          properties: {
            name: { type: 'string' },
            description: { type: 'string' },
            parameters: { type: 'object' } // JSON Schema
          }
        }
      }
    },
    toolCall: {
      type: 'object',
      required: ['id', 'type', 'function'],
      properties: {
        id: { type: 'string' },
        type: { const: 'function' },
        function: {
          type: 'object',
          required: ['name', 'arguments'],
          properties: {
            name: { type: 'string' },
            arguments: { type: 'string' }
          }
        }
      }
    },
    functionChoice: {
      type: 'object',
      required: ['name'],
      properties: {
        name: { type: 'string' }
      }
    }
  }
};
```

### Anthropic Schemas

