# Provider 模块

Provider 模块是流水线架构的第 4 层（最终层），负责与 AI 服务提供商进行 HTTP 通信。它接收来自 Compatibility 层的标准化请求，发送给对应的 AI 服务，并将原始响应返回给上层处理。

## 🎯 模块概述

Provider 模块作为流水线的最终执行层，专注于：
- **HTTP 通信**: 标准的 HTTP 请求/响应处理
- **认证管理**: 多种认证方式支持（API Key、OAuth 2.0 等）
- **错误处理**: 统一的错误处理和重试机制
- **性能监控**: 请求性能统计和健康检查

## 📁 支持的 Provider

